<?php
class Solution {

    /**
     * @desc 超时
     * @user chenlei
     * @param $nums
     * @return float|in
     *
     */
    static function findMaxLength($nums) {
        $len = count($nums);
        $longest = 0;
        if ($len < 2) {
            return 0;
        } elseif ($len == 2) {
            $count_arr = array_count_values($nums);
            if (isset($count_arr[0]) && isset($count_arr[1]) && ($count_arr[0] == $count_arr[1])) {
                return 2;
            } else {
                return 0;
            }
        }
        for ($i = 0; $i < $len; $i++) {
            if ($len - $i < $longest) {
                break;
            }
            for ($j = 1; $j < $len; $j++) {
                $length = 2 * $j;
                if ($length > $len - $i || $length < $longest || $longest > $len - $j) {
                    break;
                }
                $arr_tmp = array_slice($nums, $i, $length);
                if (self::checkEqual($arr_tmp)) {
                    if ($longest < $length) {
                        $longest = $length;
                    }
                }
            }
        }
        return $longest;
    }

    static function checkEqual($arr) {
        $value = 0;
        foreach ($arr as $v) {
            if ($v == 0) {
                $v = -1;
            }
            $value += $v;
        }
        return $value == 0;
    }
}
